import React from "react";

import Card from "../UI/Card/Card";

const HikeDetails = (props) => {
  return (
    <li>
      <Card>
        {/* <h1>{props.id}</h1> */}
        <p>{props.name}</p>
        <p>{props.date.split("T")[0]}</p>
      </Card>
    </li>
  );
};

export default HikeDetails;
